const addUser = async req => {
  const token = req.headers.authorization;
  try {
    const { user } = await jwt.verify(token, SECRET);
    req.user = user;
  } catch (err) {
    if (err.message === "jwt expired") console.log("got and old token.");
  }
  req.next();
};

app.use(cors("*"));

app.use(addUser);

app.use(
  "/graphiql",
  graphiqlExpress({
    endpointURL: "/api"
  })
);

app.use(
  "/api",
  bodyParser.json(),
  graphqlExpress(req => ({
    schema,
    context: {
      SECRET,
      user: req.user
    }
  }))
);

app.listen(PORT);

